import React from "react";
import CardForCart from "./CardForCart";

const PopUpCartWindow = () => (
  <div
    style={{
      border: "2px solid",
      width: "300px",
      height: "300px",
      backgroundColor: "white",
      zIndex: 9999,
    }}
  >
    <CardForCart></CardForCart>
  </div>
);

export default PopUpCartWindow;
